import React, { useEffect } from "react";
import Cookies from "js-cookie";

function Profile() {
  const user_id = Cookies.get("user-id");
  useEffect(() => {}, []);
  return (
    <div>
      <div>{user_id}</div>
    </div>
  );
}

export default Profile;
